import React from "react";
import styled from "styled-components";

export default function end() {
  return (
    <EndWrite>
      <img src="img/뽀로로인사.png" alt="인사하는 뽀로로 친구들" />
      끝났어요~!!!!!
    </EndWrite>
  );
}

const EndWrite = styled.div`
  font-size: 100px;
  font-weight: 900;
  padding: 10%;
  text-align: center;
  display: flex;
  flex-direction: column-reverse;

  img {
    width: 500px;
    align-items: center;
  }
`;
